import React, {
  Component
} from 'react';
import search from '../../../_assets/images/menu/search.svg';
import {
  Scrollbars
} from 'react-custom-scrollbars';
class Organisation extends Component {
  constructor(props, context) {
    super(props, context)
    this.state = {
      top: 0
    };
    this.renderView = this.renderView.bind(this);
  }
  renderView({
    style,
    ...props
  }) {
    const {
      top
    } = this.state;
    const color = top * 255;
    const customStyle = {
      backgroundColor: `rgb(${color}, ${color}, ${color})`
    };
    return ( <
      div {
        ...props
      }
      style = {
        {
          ...style,
          ...customStyle
        }
      }
      />
    );
  }
  render() {
    return ( <
      div className = "org_browser" >
      <
      h3 className = "text-center text-white" > Organisation Browser < /h3> <
      div className = "org-selector" >
      <
      p className = "text-white text-left" > Org selector < /p> <
      input type = "text"
      className = "search-input" / >
      <
      img src = {
        search
      }
      alt = "starlify"
      className = "search-icon" / >
      <
      /div> <
      div className = "division w-100 d-inline-block" >
      <
      p className = "text-white text-left" > Division < /p> <
      Scrollbars renderView = {
        this.renderView
      }
      onScrollFrame = {
        this.handleScrollFrame
      } {
        ...this.props
      } >
      <
      ul >
      <
      li className = "division-item" > Division < /li> <
      li className = "division-item" > Division < /li> <
      li className = "division-item" > Division < /li> <
      li className = "division-item" > Division < /li> <
      li className = "division-item" > Division < /li> <
      li className = "division-item" > Division < /li> <
      li className = "division-item" > Division < /li> <
      li className = "division-item" > Division < /li> <
      /ul> <
      /Scrollbars> <
      /div> <
      div className = "team" >
      <
      p className = "text-white text-left" > Division < /p> <
      ul >
      <
      li className = "division-item" > Division < /li> <
      li className = "division-item" > Division < /li> <
      li className = "division-item" > Division < /li> <
      li className = "division-item" > Division < /li> <
      li className = "division-item" > Division < /li> <
      li className = "division-item" > Division < /li> <
      li className = "division-item" > Division < /li> <
      li className = "division-item" > Division < /li> <
      /ul> <
      /div> <
      /div>
    )
  }
}

export default Organisation;
